class CampgroundService{constructor(t){this.Campground=t,this.create=this.create.bind(this),this.getAll=this.getAll.bind(this),this.findAllMatches=this.findAllMatches.bind(this),this.findById=this.findById.bind(this),this.findByIdAndUpdate=this.findByIdAndUpdate.bind(this)}async create(t){return await this.Campground.create(t),t}async getAll(){return await this.Campground.find({})}async findAllMatches(t,i){return await this.Campground.find().where(t).equals(i)}async findById(t){return await this.Campground.findById(t)}async findByIdAndUpdate(t,i){return await this.Campground.findByIdAndUpdate(t,i)}}module.exports=CampgroundService;